June 16, 2011

Diamond has recently decided that she wants kids. Her plans hit a wall when her and her husband find out about her infertility. After months of trying to have a baby, Diamond is ready to talk to an expert. Dr. Johnson is a pro, and he\'ll do everything he can to help Diamond, and if that means giving her a good old fashioned creampie, then so be it.
